// src/components/RecipeCard.js
import React from 'react';

const RecipeCard = ({ recipe }) => {
  return (
    <div className="recipe-card">
      <h2>{recipe.title}</h2>
      <p>{recipe.summary}</p>
      {/* Other recipe details */}
    </div>
  );
};

export default RecipeCard;
